import './nav.css'

import React, { useState, useRef, useEffect } from 'react';
import { Link } from 'react-router-dom';


export default function Nav() {

        const arr = ['Sched', 'Notif', 'Prof'];
        
        for(let i = 0; i < 3; i++){
            const name = 'is' + arr[i] + 'Hovered';
            const setName = 'setIs' + arr[i] + 'Hovered';
        };

        

        // const [isSchedHovered, setIsSchedHovered] = useState(false);
        // const [isNotifHovered, setIsNotifHovered] = useState(false);
        // const [isProfHovered, setIsProfHovered] = useState(false);

        // const handleMouseOver_Sched = () => {
        //   setIsSchedHovered(!isSchedHovered);
        //   console.log(isSchedHovered);
        // };

        // const handleMouseLeave_Sched = () => {
        //     setIsSchedHovered(false);
        //     console.log(isSchedHovered);
        //   };
          
        // const handleMouseOver_Notif = () => {
        //   setIsNotifHovered(!isNotifHovered);
        //   console.log(isNotifHovered);
        // };

        // const handleMouseLeave_Notif = () => {
        //     setIsNotifHovered(false);
        //     console.log(isNotifHovered);
        //   };
        
        // const handleMouseOver_Prof= () => {
        //   setIsProfHovered(!isProfHovered);
        //   console.log(isProfHovered);
        // };

        // const handleMouseLeave_Prof= () => {
        //     setIsProfHovered(false);
        //     console.log(isProfHovered);
        //   };
        

    return(

        <nav>
        <div class="left-nav">
            <a href = "asses.html"><h1>LOGO CalmSpace</h1></a>
            <ul>
                <a href = "asses.html"><li id = "asses">Assessments</li></a>
                <a href = "exercise.html"><li id = "exercise">Exercises</li></a>
                <a href = "resource.html"><li id = "resource">Resource Hub</li></a>
            </ul>
        </div>
        <div class="right-nav">

            <a href="#" class = "button">Clinic</a>
            
            <div class="r-n-icon" id = "schedule">
                <a href = "#" onMouseEnter ={handleMouseOver_Sched} onMouseLeave ={handleMouseLeave_Sched}><ion-icon name="calendar"></ion-icon></a>
                <div class="nav-pop-up" id = "schedule-pop" style = {{display : isSchedHovered === true ? 'flex' : 'none'}}>
                    <div class="pop-up-head">
                        <p>Schedule</p>
                    </div>
                    <div class="pop-up-null">
                        <ion-icon name="calendar-clear" class = "pop-up-icon"></ion-icon>
                        <p>No schedule yet</p>
                    </div>
                    <div class="pop-up-main">

                    </div>
                    <div class="view-all">
                        <a href = "#">View all schedule <ion-icon name="chevron-forward" class = "pop-up-go"></ion-icon></a>
                    </div>
                </div>
            </div>
            <div class="r-n-icon" id = "notification">
                <a href = "#" onMouseEnter ={handleMouseOver_Notif} onMouseLeave ={handleMouseLeave_Notif}><ion-icon name="notifications"></ion-icon></a>
                <div class="nav-pop-up" id = "notification-pop" style = {{display : isNotifHovered === true ? 'flex' : 'none'}}>
                    <div class="pop-up-head">
                        <p>Notification</p>
                    </div>
                    <div class="pop-up-null">
                        <ion-icon name="notifications-off" class = "pop-up-icon"></ion-icon>
                        <p>No notification yet</p>
                    </div>
                    <div class="pop-up-main">
                        {/* <div class="pop-up-sched"></div> */}
                    </div>
                    <div class="view-all">
                        <a href = "#">View all notification <ion-icon name="chevron-forward" class = "pop-up-go"></ion-icon></a> 
                    </div>
                </div>
            </div>
            <div class="r-n-icon" id = "profile">
